import React, { } from 'react';
import { useDropzone } from "react-dropzone";

const testPicUpload = () => {

    const uploadImage = (files) => {
        console.log(files)
    };

    return (
        <div>
            <input type="file" onChange={(event) => {
                uploadImage(event.target.files);
            }}/>
        </div>
    );
}

export default testPicUpload;
